import axios from "axios";
import { SET_SOCK_COLOR } from "../actions/types";

const initialState = {
	color: {}
};

export default function(state = initialState, action) {
	switch (action.type) {
		case SET_SOCK_COLOR:
			return {
				...state,
				color: action.payload
			};

		default:
			return state;
	}
}
